import logo from "./logo.svg";
import "./App.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
  useHistory,
  useLocation
} from "react-router-dom";
import About from "./About/About";
import Services from "./Services/Services";
import Header from "./Header/Header";
import Footer from "./Footer/Footer";
import Navbar from "./Navbar/Navbar";

function App() {
  return (
    <>
<Navbar>

</Navbar>
    <Router>
      <Header>
        </Header>
      <Switch>
        <Route path="/about">
          <About></About>
        </Route>
        <Route path="/services">
          <Services></Services>
        </Route>
      </Switch>
      <Footer>
      </Footer>
    </Router>
    </>
  );
}

export default App;
